library ieee;
use ieee.std_logic_1164.all;
use ieee.numeric_std.all;
library std;
use std.textio.all;

LIBRARY work;
USE work.ALL;
USE work.Components.ALL;

entity conv16_core1_rmcm is
    generic
    (
        PIPELINE_STEPS             : natural := 3
    );
    port
    (
        clk : in std_logic;
    
        SEL : in  std_logic_vector(bits(256-1)-1 downto 0);
    
        X0 : in  std_logic_vector(7-1 downto 0); --	ufix(3, -4)
        R_ : out std_logic_vector(14-1 downto 0);   --	sfix(5, -9)
        R_ : out std_logic_vector(15-1 downto 0);   --	sfix(6, -9)
        R_ : out std_logic_vector(14-1 downto 0);   --	sfix(5, -9)
        R_ : out std_logic_vector(15-1 downto 0);   --	sfix(6, -9)
        R_ : out std_logic_vector(15-1 downto 0);   --	sfix(6, -9)
        R_ : out std_logic_vector(15-1 downto 0);   --	sfix(6, -9)
        R_ : out std_logic_vector(14-1 downto 0);   --	sfix(5, -9)
        R_ : out std_logic_vector(14-1 downto 0);   --	sfix(5, -9)
        R_ : out std_logic_vector(13-1 downto 0);   --	sfix(4, -9)
        R_ : out std_logic_vector(10-1 downto 0)  --	sfix(1, -9)
    );
end conv16_core1_rmcm;

architecture arch of conv16_core1_rmcm is

    type PIPELINE_TYPE_FOR_X0_SIGNAL            is array(0 to 1) of std_logic_vector(7-1 downto 0);
    type PIPELINE_TYPE_FOR__WEIGHT is array(0 to 1) of std_logic_vector(8-1 downto 0);
    type PIPELINE_TYPE_FOR__WEIGHT is array(0 to 1) of std_logic_vector(8-1 downto 0);
    type PIPELINE_TYPE_FOR__WEIGHT is array(0 to 1) of std_logic_vector(8-1 downto 0);
    type PIPELINE_TYPE_FOR__WEIGHT is array(0 to 1) of std_logic_vector(8-1 downto 0);
    type PIPELINE_TYPE_FOR__WEIGHT is array(0 to 1) of std_logic_vector(8-1 downto 0);
    type PIPELINE_TYPE_FOR__WEIGHT is array(0 to 1) of std_logic_vector(8-1 downto 0);
    type PIPELINE_TYPE_FOR__WEIGHT is array(0 to 1) of std_logic_vector(8-1 downto 0);
    type PIPELINE_TYPE_FOR__WEIGHT is array(0 to 1) of std_logic_vector(8-1 downto 0);
    type PIPELINE_TYPE_FOR__WEIGHT is array(0 to 1) of std_logic_vector(8-1 downto 0);
    type PIPELINE_TYPE_FOR__WEIGHT is array(0 to 1) of std_logic_vector(8-1 downto 0);

    -- The input to the RMCM
    -- ufix(3, -4)
    signal X0_signal            : PIPELINE_TYPE_FOR_X0_SIGNAL;

    -- All weights

    -- sfix(3, -5)
    signal _weight : PIPELINE_TYPE_FOR__WEIGHT;
    -- sfix(3, -5)
    signal _weight : PIPELINE_TYPE_FOR__WEIGHT;
    -- sfix(3, -5)
    signal _weight : PIPELINE_TYPE_FOR__WEIGHT;
    -- sfix(3, -5)
    signal _weight : PIPELINE_TYPE_FOR__WEIGHT;
    -- sfix(3, -5)
    signal _weight : PIPELINE_TYPE_FOR__WEIGHT;
    -- sfix(3, -5)
    signal _weight : PIPELINE_TYPE_FOR__WEIGHT;
    -- sfix(3, -5)
    signal _weight : PIPELINE_TYPE_FOR__WEIGHT;
    -- sfix(3, -5)
    signal _weight : PIPELINE_TYPE_FOR__WEIGHT;
    -- sfix(3, -5)
    signal _weight : PIPELINE_TYPE_FOR__WEIGHT;
    -- sfix(3, -5)
    signal _weight : PIPELINE_TYPE_FOR__WEIGHT;

    -- The zero output
    signal  : std_logic_vector(10-1 downto 0); --	sfix(1, -9)

    -- If we use LUT multiplier and the input is unsigned, we have to cut away the msb of the result
    -- If this is the case, the temporary results are stored in the signals below.

    signal R__undelayed : std_logic_vector(14-1 downto 0);


begin
     <= (others => '0');
    R_ <= ;
    X0_signal(0) <= X0;



    WEIGHT_ROM: entity work.conv16_core1_rmcm_weightsconstant_memory
        generic map
        (
            XI_WIDTH        	          => 8, 
            ARRAY_SIZE                    => 256,
            WORDS_PER_ADDR                => 9
        )
        port map
        (
            clk => clk,
            data_index => unsigned(SEL),
        
            dout1   => _weight(0), 
            dout2   => _weight(0), 
            dout3   => _weight(0), 
            dout4   => _weight(0), 
            dout5   => _weight(0), 
            dout6   => _weight(0), 
            dout7   => _weight(0), 
            dout8   => _weight(0), 
            dout9   => _weight(0)
        );



    -- Add a pipeline step
    PL_STEP_0_for_X0_signal: entity work.Pipe_Vector PORT MAP(clk, '1', X0_signal(0), X0_signal(1));
    PL_STEP_0_for__weight: entity work.Pipe_Vector PORT MAP(clk, '1', _weight(0), _weight(1));
    PL_STEP_0_for__weight: entity work.Pipe_Vector PORT MAP(clk, '1', _weight(0), _weight(1));
    PL_STEP_0_for__weight: entity work.Pipe_Vector PORT MAP(clk, '1', _weight(0), _weight(1));
    PL_STEP_0_for__weight: entity work.Pipe_Vector PORT MAP(clk, '1', _weight(0), _weight(1));
    PL_STEP_0_for__weight: entity work.Pipe_Vector PORT MAP(clk, '1', _weight(0), _weight(1));
    PL_STEP_0_for__weight: entity work.Pipe_Vector PORT MAP(clk, '1', _weight(0), _weight(1));
    PL_STEP_0_for__weight: entity work.Pipe_Vector PORT MAP(clk, '1', _weight(0), _weight(1));
    PL_STEP_0_for__weight: entity work.Pipe_Vector PORT MAP(clk, '1', _weight(0), _weight(1));
    PL_STEP_0_for__weight: entity work.Pipe_Vector PORT MAP(clk, '1', _weight(0), _weight(1));
    PL_STEP_0_for__weight: entity work.Pipe_Vector PORT MAP(clk, '1', _weight(0), _weight(1));


    __DUAL_MULT: entity work.DualMultDSP
	generic map
		(
			A_WIDTH => 8,
			B_WIDTH => 6,
			C_WIDTH => 7, --	ufix(3, -4)
            FRAC_TRUNCATION => 0,
            C_IS_SIGNED => False,
            DISABLE_PIPELINING => False
		)
	port map
		(
            clk => clk,
			A	=> _weight(1)(8-1 downto 0),
			B	=> _weight(1)(6-1 downto 0),
			C	=> X0_signal(1),
			CxA => R_,
			CxB => R_
		);

    __DUAL_MULT: entity work.DualMultDSP
	generic map
		(
			A_WIDTH => 8,
			B_WIDTH => 7,
			C_WIDTH => 7, --	ufix(3, -4)
            FRAC_TRUNCATION => 0,
            C_IS_SIGNED => False,
            DISABLE_PIPELINING => False
		)
	port map
		(
            clk => clk,
			A	=> _weight(1)(8-1 downto 0),
			B	=> _weight(1)(7-1 downto 0),
			C	=> X0_signal(1),
			CxA => R_,
			CxB => R_
		);

    __DUAL_MULT: entity work.DualMultDSP
	generic map
		(
			A_WIDTH => 8,
			B_WIDTH => 7,
			C_WIDTH => 7, --	ufix(3, -4)
            FRAC_TRUNCATION => 0,
            C_IS_SIGNED => False,
            DISABLE_PIPELINING => False
		)
	port map
		(
            clk => clk,
			A	=> _weight(1)(8-1 downto 0),
			B	=> _weight(1)(7-1 downto 0),
			C	=> X0_signal(1),
			CxA => R_,
			CxB => R_
		);

    __DUAL_MULT: entity work.DualMultDSP
	generic map
		(
			A_WIDTH => 8,
			B_WIDTH => 7,
			C_WIDTH => 7, --	ufix(3, -4)
            FRAC_TRUNCATION => 0,
            C_IS_SIGNED => False,
            DISABLE_PIPELINING => False
		)
	port map
		(
            clk => clk,
			A	=> _weight(1)(8-1 downto 0),
			B	=> _weight(1)(7-1 downto 0),
			C	=> X0_signal(1),
			CxA => R_,
			CxB => R_
		);




    _MULT: entity work.TruncatedSingleMult
	generic map
		(
            A_WIDTH           => 8, --	sfix(3, -5)
            A_TRUNCATED_WIDTH => 7, -- This would be the MSB position of the weight
            B_WIDTH           => 7, --	ufix(3, -4)
            AxB_WIDTH         => 14, --	sfix(5, -9)
            AxB_FRAC_TRUNCATION => 0,
            B_IS_SIGNED       => False,
            DISABLE_PIPELINING => False
		)
	port map
		(
            clk => clk,
			A	=> _weight(1),
			B	=> X0_signal(1),
			AxB	=> R_
		);

end architecture;
